// Home.js
import React from 'react';

const Home = () => {
  return (
    <div class="" style="backgroundColor: #FAFBFD; padding: 50px 100px 20px 100px;">
      <div class="row">
        <div class="col-sm-12 col-lg-5 my-auto" data-aos="fade-right" data-aos-duration="1000" data-aos-once="true">
                <h2>Welcome to <br /><span style="fontSize: 40px; text-transform: uppercase; color: #7C66AC;">Phishducation!</span></h2>
                <p style="fontSize: 24px; lineHeight: 110%;">Welcome to the Phishducation application! Our goal is to make you better at finding phishing emails, and to make that process easy!</p>
                <br />
                <button class="dashBtn" onclick="window.location.href = ''" style="color: white; display:inline-block; width: 155px">Dashboard</button>
                <button class="dashBtn2" style="color: white; display:inline-block; width: 155px">View Courses</button>

                <p style="fontSize: 26px; lineHeight: 110%;">Start by <a href="/login/">logging in</a> or <a href="/signup/">registering!</a></p>

        </div>
        <div class="col-sm-12 col-lg-7">
            <img src= '{% static "/images/hero.png" %}' alt="hero" style="max-height: 700px;" />
        </div>
    </div>
   </div>
  );
};

export default Home;
